import React, {Component} from 'react';
import StudiesService from "../services/DicomService";
import StudiesTable from '../components/StudiesTable';


//初始化需要再此页面显示表格的数组  
const show=[];
class StudiesPage extends Component {
    constructor(props) {
        super(props);
        this.state = {
            studies: [],
            showList: [],
        };
        this.setState.bind(this);
    }


    componentWillMount() {
        console.log("开始获取studies")
        StudiesService.findStudies(studyList => {
            console.log("找到studies了 如下")
            console.log(studyList);
            studyList.map(study => {
                show.push({
                    patient_name: study.patient["patient_name"],
                    study_id: study.study_instance_uid,
                    study_description: study.study_description,
                })
            });
            this.setState({
                studies: studyList,
                showList: show})
        });



    }

    render() {
        const studies = this.state.studies;    
        return (
            <div>
                <h1>Studies</h1>
                <StudiesTable data={this.state.showList}/>
            </div>
        )
    }
}


export default StudiesPage;
